import React, {Component} from 'react'
import { ParallaxProvider } from 'react-scroll-parallax';
import App from './App';
import { useController } from 'react-scroll-parallax';

class AppContainer extends Component{
    render() {
        return (
            <ParallaxProvider>
                <App />
            </ParallaxProvider>
        );
    }
}




export default AppContainer;
